insert into `article` values('18','10','0','2','Contacto','Contacto','Contacto','Contacto','<div>\r\n<div style=\"float: right;\">\r\n<div style=\"color: #000;font-size: 14px;line-height: 25px;\"><img alt=\"\" src=\"/images/concact_0.png\" style=\"display: inline-block;vertical-align: middle;margin-right: 10px;\" />Email Now!</div>\r\n\r\n<div style=\"color: #000;font-size: 14px;line-height: 25px;\"><img alt=\"\" src=\"/images/concact_1.png\" style=\"display: inline-block;vertical-align: middle;margin-right: 10px;\" />Chat Now!</div>\r\n\r\n<div style=\"color: #000;font-size: 14px;line-height: 25px;\"><img alt=\"\" src=\"/images/concact_2.png\" style=\"display: inline-block;vertical-align: middle;margin-right: 10px;\" />Chat Now!</div>\r\n</div>\r\n<img alt=\"\" src=\"/images/6.jpg\" style=\"display: inline-block;vertical-align: top;\" />\r\n<div style=\"display: inline-block;vertical-align: top;margin-left: 3%;\">\r\n<div style=\"font-size: 16px;color: #333;font-weight: bold;\">Mr. Justin Johnson</div>\r\n\r\n<table border=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 120px;font-size: 14px;color: #646464;line-height: 170%;\">Department:</td>\r\n			<td>Sales</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"font-size: 14px;color: #646464;line-height: 170%;\">Job Title:</td>\r\n			<td>Sales Manager</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"font-size: 14px;color: #646464;line-height: 170%;\">Telephone:</td>\r\n			<td>86-20-26290500</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"font-size: 14px;color: #646464;line-height: 170%;\">Mobile Phone:</td>\r\n			<td>86 135602523633</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"font-size: 14px;color: #646464;line-height: 170%;\">Counrty/Region:</td>\r\n			<td>China</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"font-size: 14px;color: #646464;line-height: 170%;\">Province/State:</td>\r\n			<td>GuangDong</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"font-size: 14px;color: #646464;line-height: 170%;\">City:</td>\r\n			<td>Guangzhou</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"font-size: 14px;color: #646464;line-height: 170%;\">Address:</td>\r\n			<td>Jinde Building, Wende street, Yuexiu District</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"font-size: 14px;color: #646464;line-height: 170%;\">Website:</td>\r\n			<td><a href=\"http://www.ailop.com\" style=\"color:blue;\">http://www.ailop.com</a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<div style=\"clear:both;\">&nbsp;</div>\r\n</div>\r\n\r\n<div style=\"font-size: 12px;line-height: 24px;padding: 30px 20px;border-top:1px solid #e8e7e7;border-bottom:1px solid #e8e7e7;color: #333;margin: 20px 0;\">Guangzhou LY network technology co., LTD., founded in 2007, has been focused on the foreign trade website construction, independent research and development for cross-border electricity trading UEESHOP system, has more than 3000 clients, customers in more than 50 countries around the world. In a mobile electricity raged, UEESHOP has been upgraded to version 2.0, and continually upgrade to optimize the user experience, insist on the most expensive server, the fastest response speed of customer service, make UEESHOP become the first brand of domestic foreign trade website building services.</div>\r\n\r\n<div style=\"text-align: center;\"><img alt=\"\" src=\"/images/5.jpg\" /></div>','/contacto.html','0','0');
insert into `article` values('19','10','0','3','Index Informacin de la empresa','Index Informacin de la empresa','Index Informacin de la empresa','Index Informacin de la empresa','<div style=\"font-size: 14px;line-height: 24px;color: #333;\">Shenzhen Topworld Technology Co.,Limited was established in 2007. We specialize in the manufacture of mobile phone, tablet and electronic accessory. Because of our quality products and comprehensive service, clients from North and South America, Europe ... <a href=\"\" style=\"color: #1b3d7d;text-decoration: underline;\" title=\"\">more</a></div>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" style=\"border:none;margin-top: 19px;color: #333;\">\r\n	<tbody>\r\n		<tr style=\"background: #dfeafd;height: 22px;\">\r\n			<td style=\"text-indent: 14px;\" width=\"228\">Location:</td>\r\n			<td width=\"285\">Guangdong, China (Mainland)</td>\r\n		</tr>\r\n		<tr style=\"height: 28px;\">\r\n			<td style=\"text-indent: 14px;\" width=\"228\">Year Established:</td>\r\n			<td width=\"285\">2012</td>\r\n		</tr>\r\n		<tr style=\"background: #dfeafd;height: 22px;\">\r\n			<td style=\"text-indent: 14px;\" width=\"228\">Business Type:</td>\r\n			<td width=\"285\">Trading Company</td>\r\n		</tr>\r\n		<tr style=\"height: 28px;\">\r\n			<td style=\"text-indent: 14px;\" width=\"228\">Total Annual Sales Volume:</td>\r\n			<td width=\"285\">US$1 Million - US$2.5 Million</td>\r\n		</tr>\r\n		<tr style=\"background: #dfeafd;height: 22px;\">\r\n			<td style=\"text-indent: 14px;\" width=\"228\">Main Products:</td>\r\n			<td width=\"285\">Mobile Phone,Tablet PC</td>\r\n		</tr>\r\n		<tr style=\"height: 28px;\">\r\n			<td style=\"text-indent: 14px;\" width=\"228\">Main Markets:</td>\r\n			<td width=\"285\">South Asia, Southern Europe, Northern</td>\r\n		</tr>\r\n	</tbody>\r\n</table>','/index-informacin-de-la-empresa.html','0','0');
