insert into `info_two_contents` values('48','48','<strong>Open API</strong><span style=\"color:rgb(0, 0, 0); font-family:-apple-system,blinkmacsystemfont,roboto,open sans,helvetica neue,sans-serif; font-size:13px; line-height:20.8px\">&nbsp;is a system for developers of third party sites which enables easy authorization of VK users on your site. Also, if users agree, you can get access to information about their friends, photos, audios, videos and other VK data for deeper integration with your project.&nbsp;&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:-apple-system,blinkmacsystemfont,roboto,open sans,helvetica neue,sans-serif; font-size:13px; line-height:20.8px\">As part of connection to&nbsp;</span><strong>Open API</strong><span style=\"color:rgb(0, 0, 0); font-family:-apple-system,blinkmacsystemfont,roboto,open sans,helvetica neue,sans-serif; font-size:13px; line-height:20.8px\">,&nbsp;a special application is created which allows to use all current VK API methods on your site. In addition,&nbsp;</span><strong>Open API</strong><span style=\"color:rgb(0, 0, 0); font-family:-apple-system,blinkmacsystemfont,roboto,open sans,helvetica neue,sans-serif; font-size:13px; line-height:20.8px\">&nbsp;can simplify registration of new users on your site if they already have a VK account.&nbsp;</span>');
insert into `info_two_contents` values('49','49','<strong>Open API</strong><span style=\"color:rgb(0, 0, 0); font-family:-apple-system,blinkmacsystemfont,roboto,open sans,helvetica neue,sans-serif; font-size:13px; line-height:20.8px\">&nbsp;is a system for developers of third party sites which enables easy authorization of VK users on your site. Also, if users agree, you can get access to information about their friends, photos, audios, videos and other VK data for deeper integration with your project.&nbsp;&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:-apple-system,blinkmacsystemfont,roboto,open sans,helvetica neue,sans-serif; font-size:13px; line-height:20.8px\">As part of connection to&nbsp;</span><strong>Open API</strong><span style=\"color:rgb(0, 0, 0); font-family:-apple-system,blinkmacsystemfont,roboto,open sans,helvetica neue,sans-serif; font-size:13px; line-height:20.8px\">,&nbsp;a special application is created which allows to use all current VK API methods on your site. In addition,&nbsp;</span><strong>Open API</strong><span style=\"color:rgb(0, 0, 0); font-family:-apple-system,blinkmacsystemfont,roboto,open sans,helvetica neue,sans-serif; font-size:13px; line-height:20.8px\">&nbsp;can simplify registration of new users on your site if they already have a VK account.&nbsp;</span>');
